import React from 'react';
import Card from './Card.js';
import './CSS-Playing-Cards/cards.css';

class Hand extends React.Component {
    componentDidMount(){
        var cardsInHand = this.props.player1Hand
        .map((card, index) => <Card key ={index} card={card}/>);
    }
    render(){
        return (
            <ul>
                {cardsInHand}
            </ul>
        );
    }
}

export default Hand;
